import React from 'react';
import Word from "./Word/Word";
import GetAllWord from "../../components/DataDB/DataDB";


function WordList(props) {
    function renderWord(){

        GetAllWord().then(value => {
            // let allWord = [];
            // GetAllWord().then(value => {
            //     allWord = value;
            // });
            //console.log(allWord);
            value.map(item => {
                return(
                    <Word
                        key = {item.id}
                        word = {item.word}
                        translation = {item.translation}
                    />
                )
            })})
    }
    return (
        <div>
            {renderWord()}
        </div>
    );
}

export default WordList;
